		var selected_question;	//	represents the selected question from the remaining questions
		var clothpegX, clothpegY;
		var shirt_selected;
		var shirt_interval;
		var difficulty;
		
		//	This function randomly selects and creates a question in the currently selected game.
		function createQuestion()
		{		
			//	Selecting a question from the remaining questions at random.
			//	Do NOT erase the question from the remaining questions.
			//	If the last question was mistaken (not erased from database), and there's more than one remaining question, do not repeat it.
				
			var tempIndex;	//	temporary index in the remaining questions
			if(isPrevMistake && remaining_questions.length > 1)	//	if the last question was a mistake, and there's another question to give
			{
				tempIndex = Math.floor(Math.random() * (remaining_questions.length - 1));	//	assuming the previous question was readded to the array's last position
			}
			else
			{
				tempIndex = Math.floor(Math.random() * remaining_questions.length);
			}
			
			//	cut question from the remaining questions for now, and store question in selected_question
			selected_question = remaining_questions[tempIndex].slice();
			remaining_questions.splice(tempIndex,1);
			
			console.log(selected_question);
			
			//	create graphic elements
			
			//	question graphic elements
			thisStage.getChildByName("question_question").text = selected_question[0];	//	changing question text
			
			//	reset starting shirt position
			clothpegX = parseInt(canvas.style.width) + 50;
			clothpegY = 325;
			
			//	shirt graphic element
			var temp = new lib.Shirt_new();
			thisStage.addChild(temp);
			temp.name = "shirt";
			temp.x = clothpegX;
			temp.y = clothpegY;
			temp.addEventListener("pressmove", dragShirt);
			temp.addEventListener("pressup", releaseShirt);
			
			if(selected_question[2] == "text")
			{	//	text element
				temp = new createjs.Text();
				temp.text = selected_question[1];
				temp.font = "14pt Assistant ExtraBold";
				temp.textAlign = "center";
			}
			else
			{	//	image element
				temp = new selected_question[1][0]();
			}
			thisStage.addChild(temp);
			temp.name = "shirt_text";
			temp.x = clothpegX;
			temp.y = clothpegY;
			
			//	clothespins
			temp = new lib.Clothespin();
			thisStage.addChild(temp);
			temp.name = "clothespins";
			temp.x = clothpegX;
			temp.y = clothpegY;	
			
			//	reset shirt miscellaneous settings
			if(shirt_interval == null)
			{
				shirt_interval = setInterval(advanceShirt,100);
			}
			shirt_selected = false;
		}
		
